import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Sidebar.css'

const Sidebar = () => {
    return (
        <div className="sidebar">
            <h2>Dashboard</h2>
            <ul>
                <li><Link to="/doctor-home">Dashboard</Link></li>
                <li><Link to="/doctor-home/appointments">Appointments</Link></li>
                <li><Link to="/doctor-home/patients">Patients</Link></li>
                <li><Link to="/doctor-home/reports">Reports</Link></li>
                <li><Link to="/doctor-home/prescriptions">Prescriptions</Link></li>
                <li><Link to="/doctor-home/settings">Settings</Link></li>
            </ul>
        </div>
    );
};

export default Sidebar;
